import { useState } from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import axios from 'axios';


function Register(){

    var[firstNameError, setFirstNameError]=useState("")
    var[lastNameError,setLastNameError]=useState("")
    var[emailError,setEmailError]=useState("");
    var[mobileNoError,setMobileNoError]=useState("");
    var[passwordError,setPasswordError]=useState("");
    var[userTypeError,setUserTypeError]= useState("");

    const[user,setUser]=useState({firstName:" ",lastName:" ",email:" ", password:"", mobileNo:"",userType:" "});



    const url = "http://127.0.0.1:9999/register";

    const OnTextChage =(args)=>{
        var copyOfUser={...user};
        copyOfUser[args.target.name]=args.target.value;
        setUser(copyOfUser);
    }
    
   
    const Validate=()=>{
        //initially set to empty 
        user. setFirstName("");
        user.setLastName("");
        user. setEmail(" ");
        user.setPassword("");
        user.setEmailError("");
        user.setPasswordError("");
        user. setMobileNoError(" ");
        user.setUserType("");

        if(user.firstName===""){
           user.setFirstNameError("*Please Enter Your Email")
           
        }
        if(user.lastName===""){
            user.setLastNameError("*Please Enter Your Email")
            
        }
        if(user.mobileNo===""){
            user. setEmailError("*Please Enter Your Email")
           
        }
        if(user.email===""){
            user.setEmailError("*Please Enter Your Email")
            
        }
        if (!/^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/.test(user.email)) {
            user.setEmailError("*Please enter a valid email")
           
        }
        if(""===user.password)
        {
            user. setPasswordError("*Please Enter your Password");
        }   
        if(user.password.length<8){
            user.setPasswordError("*Password must be  8 characters or Longer");
           
        }
    };


    return (
      <div className="container">
          <center>
            <br/>
            <br/>
            <br/>
            <br/>
            <form>
                <div>
                    First Name: <input type="text" value={user.firstName}  onChange={OnTextChage} />
                    <label className="text-danger">{firstNameError}</label>
                </div>
                <br/>
                <div>
                    Last Name: <input type="text" value={user.lastName} onChange={OnTextChage}  />
                    <label className="text-danger">{lastNameError}</label>
                </div>
                <br/>
                <div>
                    Email:  <input  type="email"  value={user.email} onChange={OnTextChage}  />
                    <label className="text-danger">{emailError}</label>
                </div>
                <br/>
                <div>
                    Password: <input type="password" value={user.password} onChange={OnTextChage} />
                    <label className="text-danger">{passwordError}</label>
                </div>
                <br/>
                <div>
                    Mobile Number: <input type="tel" value={user.mobileNo} onChange={OnTextChage} />
                    <label className="text-danger">{mobileNoError}</label>
                </div>
                <br/>
                <div>
                    UserType: <select value={user.userType} onChange={OnTextChage}>
                                <option value="0">Owner</option>
                                <option value="1">Customer</option>
                                </select>
                    <label className="text-danger">{userTypeError}</label> 
                </div> 
                <br/>
                <br/>
                <button className="btn btn-primary" onClick={Validate}> Register</button>
            </form> 
          </center>
      </div>
    );
  
}

export default Register;
